import React from 'react';
import FormInput from './components/FormInput';

const App = () => {
  return (
    <>
      <div className="app">
        <form>
          <FormInput placeholder="Username" />
          <FormInput placeholder="Email" />
          <FormInput placeholder="FullName" />
          <FormInput placeholder="Some Thing else" />
        </form>
      </div>
    </>
  );
};

export default App;
